class Solution:
    def lengthOfLongestSubstring(self, s:str) -> int:
        s_sub=""
        if s=="":
            return 0
        else:
            if len(s)>96:
                m=len(s)-96
            for k in range(m,len(s)):
                for j in range(0,k+1):
                    s_sub=s[j:len(s)-k+j]
                    x=0
                    for i in s_sub:
                        if s_sub.count(i)==1:
                            x=x+1
                    if x==len(s_sub):
                        return x
 
